import React from 'react';
import Hurricane from '../../assets/hurricane.svg';
import './Home.css';

function Home() {
    return (
        <div className="App">
            <header className="landing-page">
                <img src={Hurricane} alt="Hurricane"/>
            </header>
        </div>
    );
}

export default Home;
